Wyvern (2009) 


Verenigde Staten / Canada
Science-Fiction
96 minuten

geregisseerd door Steven R. Monroe
met Nick Chinlund, Erin Karpluk en Don S. Davis

Het kleine stadje Beaver Mills, in Alaska, maakt zich op voor het jaarlijkse feest. Precies op dit moment breekt een Wyvern (een gevleugeld mythisch reptiel), uit uit het ijsblok waar hij in zat. Hij valt de bewoners van het stadje aan en een bloedbad volgt. Sommige bewoners proberen wanhopig te ontsnappen. Een aantal van hen komen erachter dat de Wyvern eieren gelegd heeft...



